"""
This scripts test the endpoint for doing multi-modal RAG

It mocks the behavior of the UI which sends a query and a base64 encoded string represented the selected image
"""

import requests
import json

# Server URL
url = "http://localhost:8080/mm-q-and-a"

# Sample query

prompt = "图片里有什么？"

image_data_base64 = "data:image/png;base64,"

# Prepare the request payload
payload = {"prompt": prompt, "image": image_data_base64}

# Send the POST request
response = requests.post(url, json=payload)

# Check if the request was successful
if response.status_code == 200:
    # Parse the JSON response
    result = response.json()

    print("Query:", prompt)
    print("Response:", result["response"])
else:
    print("Error:", response.status_code, response.text)
